import React from "react";
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import {  LoginFormContainer } from "../LoginPage/styled";
import { InputsContainer } from "../LoginPage/styled";
import {useHistory} from 'react-router-dom';
import useForm from "../../hooks/useForm";

const SignUpPage = () => {
    const history = useHistory()
    const [form, onchange, clear] = useForm({ name: '', email: '', password: '' })

    const onSubmitForm = (event) => {
        event.preventDefault()
    
    }


    return (
        
        <form onSubmit={onSubmitForm}>  
            <LoginFormContainer>               
                <InputsContainer>
                    <TextField 
                        value={form.name}
                        name={"name"}
                        onChange={onchange}
                        label={"Nome"}
                        variant={"outlined"}
                        fullWidth
                        required
                        autoFocus
                        margin={"normal"}
                        />                       
                        <TextField 
                        value={form.email}
                        name={"email"}
                        onChange={onchange}
                        label={"E-mail"}
                        variant={"outlined"}
                        type={"email"}
                        fullWidth
                        required
                        autoFocus
                        margin={"normal"}
                        />
                         <TextField 
                        value={form.password}
                        name={"password"}
                        onChange={onchange}
                        label={"Senha"}
                        variant={"outlined"}
                        type={"password"}
                        fullWidth
                        required                       
                        margin={"normal"}
                        />
                </InputsContainer>
                <Button
                    colort={'primary'}
                    variant={'contained'}
                    type={'submit'}
                    fullWidth
                />

            </LoginFormContainer>
        </form>
    )
}

export default SignUpPage
